Explanation:

Let us consider sets of flowers and plants:

{Flower} = {Roses, Daisies, Tulips, Sunflowers}
{Plant} = {Rosebush, Daisy, Tulip, Sunflower}

Now, since {Flower} is a subset of {Plant}, this means that every item in {Flower} is also present in {Plant}. Therefore, some plants are also flowers.

Next, let us consider the set of green plants:

{Green Plant} = {Rosebush, Daisy, Tulip}

Since {Flower} is a subset of {Plant}, some flowers in {Flower} must also be green plants in {Green Plant}.

So, the answer to the question is YES.
